@import '../../css/element.scss';
.panel{
    @include panel;
    padding-bottom: 50px;
    .content{
        ul{
            @include flex(row);
            li{
                width: 25%;
                text-align: center;
                box-sizing: border-box;
                padding: 20px 10px;
                img{
                    width: 80px;
                    height: 80px;
                }
                p{
                    font-size: 28px;
                    color: #666;
                    margin-top: 5px;
                }
            }
        }
    }
}
